import React from 'react'
import styles from './categorie.module.css'

function Categorie() {
  const list = [
    {
      id: 1,
      name: 'Пиццы'
    },
    {
      id: 2,
      name: 'Десерты'
    },
    {
      id: 3,
      name: 'Закуски'
    },
    {
      id: 4,
      name: 'Напитки'
    },
  ]

  const categorie = list.map(obj =>
    <div className={styles.list} key={obj.id}>
      {obj.name}
    </div>)

  return (
    <div>
      {categorie}
    </div>
  )
}

export default Categorie
